class FilterSelect extends Component {


    render() {




        return (
            <select>
                <option value="all">Choisir...</option>
                <option value="pomme">Pomme</option>
                <option value="banane">Banane</option>
                <option value="ravioli">Ravioli</option>
            </select>
        )
    }
}



export default FilterSelect;
